function setStatus(ok,msg){ els.status.classList.toggle("error",!ok); els.statusText.textContent=msg }
function enableUI(on){ els.input.disabled=!on; els.clearBtn.disabled=!on; els.copyBtn.disabled=!on }
function convertSorted(s){
  if(!state.loaded) return s;
  const KEYS = Object.keys(RULES).sort((a,b)=>b.length-a.length);
  let out='', i=0;
  for (const _ of s) {
    if (i>=s.length) break;
    let matched=false;
    for (const k of KEYS) {
      if (s.startsWith(k, i)) { out += RULES[k]; i += k.length; matched=true; break }
    }
    if (!matched) {
      for (const ch of s.slice(i, i+1)) { out += ch }
      i += 1;
    }
  }
  return out;
}
function coverage(s){
  let total=0, hit=0; const misses=new Set();
  for (const ch of s){
    total++;
    if (Object.prototype.hasOwnProperty.call(RULES, ch)) hit++;
    else misses.add("U+"+ch.codePointAt(0).toString(16).toUpperCase().padStart(4,"0"));
  }
  return { total, hit, misses:[...misses].slice(0,12) };
}
let rafId=null; function scheduleConvert(){
  if(rafId!==null) cancelAnimationFrame(rafId);
  rafId=requestAnimationFrame(()=>{
    rafId=null;
    const src=els.input.value;
    const pre=cp936Pre(src);
    const raw=convertSorted(pre);
    const norm=raw.replace(/\u0F0B(?=[\u0F0D\u0F0E])/g,'');
    els.output.value=norm;
    const c=coverage(pre);
    if(els.ruleCount){
      els.ruleCount.textContent="规则数量："+state.ruleCount+" ｜ 覆盖："+c.hit+"/"+c.total+(c.misses.length?(" ｜ 未覆盖："+c.misses.join(",")):"");
    }
  })
}
function bindActions(){
  els.input.addEventListener("input", scheduleConvert); els.clearBtn.addEventListener("click", ()=>{ els.input.value=""; els.output.value=""; els.input.focus() });
  els.copyBtn.addEventListener("click", async ()=>{ try{ await navigator.clipboard.writeText(els.output.value); setStatus(true, "已复制"); setTimeout(()=>setStatus(true, "映射已内置"), 1200) }catch(_){} });
}
function addRule(k,v){
  if (!Object.prototype.hasOwnProperty.call(RULES,k)){
    RULES = Object.freeze(Object.assign({}, RULES, { [k]: v }));
  }
}
async function buildTokMapFromBzd(){
  const res = await fetch('./BZD.bin');
  if(!res.ok) return null;
  const buf = await res.arrayBuffer();
  const text = new TextDecoder('utf-16le').decode(buf);
  const arr = Array.from(text);
  const fwd = new Map();
  const rev = new Map();
  for (let i=1;i<arr.length-2;i++){
    if (arr[i].charCodeAt(0)===0x1518 && arr[i+1].charCodeAt(0)===0x151F){
      const L = arr[i-1];
      const R = arr[i+2];
      if (!fwd.has(L)) fwd.set(L, new Set());
      fwd.get(L).add(R);
      if (!rev.has(R)) rev.set(R, new Set());
      rev.get(R).add(L);
    }
  }
  return { fwd, rev };
}
function resolveViaGraph(start, graph, limit){
  const tib = ch => { const cp=ch.codePointAt(0); return cp>=0x0F00&&cp<=0x0FFF };
  const has = ch => Object.prototype.hasOwnProperty.call(RULES, ch);
  const outOf = ch => has(ch) ? RULES[ch] : (tib(ch) ? ch : null);
  const q=[start]; const seen=new Set([start]); let depth=0;
  while (q.length && depth<limit){
    const n=q.shift();
    const o=outOf(n);
    if (o) return o;
    const nxts = graph.get(n);
    if (nxts) for (const v of nxts){ if (!seen.has(v)){ seen.add(v); q.push(v) } }
    if (q.length===0) depth++;
  }
  return null;
}
async function learnFromBzdBin(missList, srcSnapshot){
  try{
    state.mergedTries = (state.mergedTries||0)+1;
    const maps = await buildTokMapFromBzd();
    if (!maps) return false;
    const fwd = maps.fwd;
    let changed=false;
    for (const m of missList){
      const hex = m.replace('U+','');
      const ch = String.fromCodePoint(parseInt(hex,16));
      const out = resolveViaGraph(ch, fwd, 20);
      if (out){
        addRule(ch, out);
        changed = true;
      }
    }
    return changed;
  }catch(_){ return false }
}
async function tryMergeFromBzdBin(){
  try{
    const res = await fetch('./BZD.bin');
    if(!res.ok) return;
    const buf = await res.arrayBuffer();
    const dec = new TextDecoder('utf-16le');
    const text = dec.decode(buf);
    let added = 0;
    const arr = Array.from(text);
    for (let i=1;i<arr.length-2;i++){
      if (arr[i].charCodeAt(0)===0x1518 && arr[i+1].charCodeAt(0)===0x151F){
        const L = arr[i-1];
        const R = arr[i+2];
        let val = null;
        const cp = R.codePointAt(0);
        if (cp>=0x0F00 && cp<=0x0FFF) val = R;
        else if (Object.prototype.hasOwnProperty.call(RULES, R)) val = RULES[R];
        if (val && !Object.prototype.hasOwnProperty.call(RULES, L)){ addRule(L, val); added++; }
      }
    }
    state.merged = true;
    state.ruleCount = Object.keys(RULES).length;
    if(els.ruleCount) els.ruleCount.textContent="规则数量："+state.ruleCount;
  }catch(_){}
}
function decodeNumsToString(nums){
  let s = '';
  for (const n of nums){ s += String.fromCodePoint(n); }
  return s;
}
function parseTblNumbers(txt){
  const m = txt.match(/\d+/g);
  if (!m) return [];
  const arr = m.map(x=>parseInt(x,10));
  const out = [];
  let i=0;
  while (i<arr.length){
    const src = arr[i++];
    if (!(src>=40960)) continue;
    const targets=[];
    while (i<arr.length && arr[i]<40960){ targets.push(arr[i++]); }
    if (targets.length>0){ out.push([src, targets.slice()]); }
  }
  return out;
}
async function fetchTextSafe(url){
  try{ const r = await fetch(url); if(!r.ok) return null; return await r.text(); }catch(_){ return null }
}
async function listDirectory(){
  try{
    const html = await fetchTextSafe('./');
    if (!html) return [];
    const files = [];
    const re = /href="([^"]+)"/g;
    let m;
    while ((m = re.exec(html))){ const f = decodeURIComponent(m[1]); if (!f.startsWith('?') && !f.startsWith('/')) files.push(f); }
    return files;
  }catch(_){ return [] }
}
async function tryMergeFromTables(){
  try{
    const files = await listDirectory();
    const targets = files.filter(f=>/((?:^|\/)[A-Za-z]+2Uni\.tbl$)|((?:^|\/)Uni2(?!Uni)[A-Za-z]+\.tbl$)/i.test(f));
    let added=0;
    for (const f of targets){
      const t = await fetchTextSafe('./'+f);
      if (!t) continue;
      if (/2Uni\.tbl$/i.test(f)){
        const pairs = parseTblNumbers(t);
        for (const [src, arr] of pairs){
          const left = String.fromCodePoint(src);
          const right = decodeNumsToString(arr);
          if (!Object.prototype.hasOwnProperty.call(RULES,left)){
            addRule(left, right);
            added++;
          }
        }
      } else if (/^Uni2(?!Uni)[A-Za-z]+\.tbl$/i.test(f)){
        const nums = t.match(/\d+/g);
        if (!nums) continue;
        const arr = nums.map(x=>parseInt(x,10));
        for (let i=0;i+1<arr.length;i+=2){
          const u = arr[i], b = arr[i+1];
          if (u<40960 && b>=40960){
            const left = String.fromCodePoint(b);
            const right = String.fromCodePoint(u);
            if (!Object.prototype.hasOwnProperty.call(RULES,left)){
              addRule(left, right);
              added++;
            }
          } else {
            i -= 1;
          }
        }
      }
    }
    state.ruleCount = Object.keys(RULES).length;
    if(els.ruleCount) els.ruleCount.textContent="规则数量："+state.ruleCount;
  }catch(_){}
}
async function init(){
  enableUI(true);
  setStatus(true, "映射已内置");
  state.ruleCount = Object.keys(RULES).length;
  if(els.ruleCount) els.ruleCount.textContent="规则数量："+state.ruleCount;
  if (!(typeof window!=='undefined' && window.RULES_DATA && window.RULES_DATA.rules)) {
    try{ await integrateCp936File() }catch(_){}
    try{ await tryMergeFromTables() }catch(_){}
    try{ await tryMergeFromBzdBin() }catch(_){}
    augmentRulesFromCp936();
  }
  bindActions();
  scheduleConvert();
  Object.freeze(RULES);
}
document.addEventListener("DOMContentLoaded", init);
window.__runConvert = scheduleConvert;
